$GLOBALS["lang"]['<p><strong>Baseline</strong> - The overarching document that contains the baseline definition and the individual policy tests.<br> <br> <strong>Policies</strong> - The individual tests contained within a Baseline. Each test is for a specific item. An example would be testing for SSH version 1.2.3.<br> <br> <strong>Details</strong> - Baselines can compare netstat ports, users and software.<br> <br> <strong>Software</strong> - To compare software we check the name and version. Because version numbers are not all standardised in format, when we receive an audit result we create a new attribute called software_padded which we store in the database along with the rest of the software details for each package. For this reason, baselines using software policies will not work when run against a device that has not been audited by 1.10 (at least). Software policies can test against the version being "equal to", "greater than" or "equal to or greater than".<br> <br> <strong>Netstat Ports</strong> - Netstat Ports use a combination of port number, protocol and program. If all are present the policy passes.<br> <br> <strong>Users</strong> - Users work similar to Netstat Ports. If a user exists with a matching name, status and password details (changeable, expires, required) then the policy passes.<br> <br> </p>'] = '<p><strong>(1)</strong> (OL L 20 van 2015.177, blz. 42).<br/> <br/> <strong>Bendrijuje</strong> Indiffutuaj indisij enhavitaj ene de Bazlino. Mina Zondoiu testa estetas por especia objeto. Ekzemplo estos testata pri SS- versie 1.2.3.<br/> <br/> <strong>Bendrijuje</strong> Bazlinioj povas kompari precisa hasnojn, uzantojn kaj softvaron.<br/> <br/> <strong>Bendrijuje</strong> Por kompari softvaron ni controllas tendomon kaj versūne. Identyficieercar versico nombroj nestas Tial, baglinioj uzantaj softvarpolitikojn ne funkcias dum kuro kontra epäilty aparato kiu ne estis reviviita neestas 1.10 (almena kaptlus). Softvarpolitkoj povas testi kontrouna la versionrio estanta "egalaj al", "pli gra ol" kaptus al egala al difetto pli granda ol ".<br/> <br/> <strong>- Nie.</strong> Netstat Bendrijuje <br/> <br/> <strong>"L \'Unione"</strong> Uzantoj sim simiaj al Netstat Se uzanto eksistas kun egala nomo, stato kaj pasvorton detaloj (publikaan Progressiveblaj, eksvalidas, postulis) tiam la politik pasas.<br/> <br/> </p>';

