$GLOBALS["lang"]['<p>Being able to determine which machines are configured the same is a major part of systems administration and auditing &ndash; and now reporting on that will be made simple and automated. Once you define your baseline it will automatically run against a set of devices on a predetermined schedule. The output of these executed baselines will be available for web viewing, importing into a third party system or even as a printed report.<br> <br> Baselines enable you to combine audit data with a set of attributes you have previously defined (your baseline) to determine compliance of devices.<br> <br> For example - you might create a baseline from a device running Centos 6 which acts as one of your apache servers in a cluster. You know this particular server is configured just the way you want it but you are unsure if other servers in the cluster are configured exactly the same. Baselines enables you to determine this.<br> <br> </p>'] = '<p>Bendrijuje: "Suprimento" La produktado de tiuj ekekkivicitaj baglinioj estas hasbla por interretspektado, rev.<br/> <br/> Bazlinioj rajtigas vin kombini reviziodatenojn kun aro de atencij kiuj vi mbH<br/> <br/> Egzemp. Eble kreos baglinion de aparato prizorgata Centojn 6 kiu funkcia kiel uu el viaj apa reomendarserviloj en nexe<br/> <br/> </p>';

