$GLOBALS["lang"]['<p>Components is a generic term used for the tables that store the attributes for a device. Those tables are: access_point, arp, bios, certificate, cli_config, disk, dns, file, ip, license, log, memory, module, monitor, motherboard, netstat, network, nmap, optical, pagefile, partition, policy, print_queue, processor, radio, route, san, scsi, server, server_item, service, share, software, software_key, sound, task, usb, user, user_group, variable, video, vm, windows.</p><p> In addition we class the following tables also as device related: application, attachment, cluster, credential, image.</p>'] = '<p>Kompuntoj estas komuninnomo uzita por la bulloj kiuj stokas la aperiojn por aparato. Tiuj tablej sano: alirputo, arp, Bioj, aestilo, cli _ restato, dispquete, dns, dosiero, ip, licenco, tagalolo, memoro, modulo, kreno, papitalio, retato, Nmap, optica, proteeselo programma</p><p> Krome ni klazifikas la sekvajn tablelojn ankai kiel aparaton ligitán: apliki Flido, aligita...</p>';

