$GLOBALS["lang"]['<p>Microsoft Windows desktop systems have network limitations that may impact the performance of Open-AudIT. The TCP/IP stack limits the number of simultaneous incomplete outbound TCP connection attempts. After the limit is reached, subsequent connection attempts are put in a queue and will be resolved at a fixed rate (10 per second). If too many enter the queue, they may be dropped. And finally, Apache will be restarted by the OS. For this reason, installing Open-AudIT on a Windows desktop operating system is not supported.<br><br>There is nothing wrong with the Open-AudIT code, nor can we do anything to address this issue on Windows client machines.'] = '<p>"La TCP" / "IpA"). Kiam la limonka estas atinita, postaj konkomedij estas metitaj enendovicon kaj estos solvitaj Bendriejuje Kajfinfinine, establesisch Fares de la Os. Tial, puli Open- sur new - tableé opracium ne estas apogita.<br/><br/>Bendrijuje</p>';

