$GLOBALS["lang"]['A local area network (LAN) is a network that connects computers and devices in a limited geographical area such as a home, school, office building, or closely positioned group of buildings. Each computer or device on the network is a node. Wired LANs are most likely based on Ethernet technology. Newer standards such as ITU-T G.hn also provide a way to create a wired LAN using existing wiring, such as coaxial cables, telephone lines, and power lines.<br><br>The defining characteristics of a LAN, in contrast to a wide area network (WAN), include higher data transfer rates, limited geographic range, and lack of reliance on leased lines to provide connectivity. Current Ethernet or other IEEE 802.3LAN technologies operate at data transfer rates up to 100 Gbit/s, standardized by IEEE in 2010. Currently, 400 Gbit/s Ethernet is being developed.'] = 'Loka izoreto (LAN) estos reto kiu ligas komputijn kajn aparato en limigita geografia iso kiel ekzemple hejmo, lernejo, officeejkonstrua. Imitu komputilo kaptlus parato sur la reto nodo. Traadiga Lanoj estas plej ver kindjnaj surbaze de Ethernet - teknologio. Pli novaj ormoj kiel ekzemple Uit- T G.hn ankai dispoonigas manieron krei datigitan LAN uzantan ekzisztán drenadon, kiel ekimer koaksiaj kabloj, teuropa.elinoj, kaj regulklinjoj.<br/><br/>La difinaj karkteriza.oj de LAN, consite al lar rupturaa isoreto (WAN), inkludas plijn altan dann transigtarifojn, limitan geographian platati residenden, kaj mankon deposico sur lizitaj linioj por disponigi ekkonteblecon. Bendrijuje Ce datansigtarifoj εis 100 Gbit / s, normagita taire de IEEE em 2010. "Hurtigruten"';

