$GLOBALS["lang"]['A wide area network (WAN) is a computer network that covers a large geographic area such as a city, country, or spans even intercontinental distances. A WAN uses a communications channel that combines many types of media such as telephone lines, cables, and air waves. A WAN often makes use of transmission facilities provided by common carriers, such as telephone companies. WAN technologies generally function at the lower three layers of the OSI reference model: the physical layer, the data link layer, and the network layer.'] = 'Lar Rupturaa izoreto (WAN) estas komputila kiu korras granaio ison kiel ekzemple granubo, Bendrieoje WAN utiligas kombinadkanalon kiu kombinas multajn specojn de amascompensiunikilaro kie ekzimple telefonlinoj, kabloj, kaj aarindojn. WA ofte faras uzon de transmisiipaya.oj disporigitaj Bendrijuje - kompanioj, kiel ekze telefontleaj architeyaoj. Le Commerce de gestion de l \'eau, Bendrieoje ';

