$GLOBALS["lang"]['Networks respond differently depending on how they are configured. Some routers and/or firewalls can respond <i>on behalf</i> of IPs on the other side of their interfaces to the Open-AudIT Server. It is quite common to see Nmap report a probe for SNMP (UDP port 161) to respond as open|filtered for devices that do and do not exist. This is misleading as there is no device at that IP, yet it ends up with a device entry in the database. 99.9% of the time, it is not Open-AudIT, nor even Nmap, but the network causing this issue. Now that we have the options to treat open|filtered ports as either open or closed, we can eliminate a lot of this confusion. Enterprise users even have the option to change this on a per discovery basis (more than just using the Medium (Classic) item, as above).'] = 'Retoj rispitaas alimeniere riippuu de kiel ili estas formitaj. Bendrijuje <i>Bendrijuje</i> IP sur la alias Costato de iliaj interfacoj al la open- Bendrijuje Estos tre vidi Nmap- raporton enketo por SNMP (UDP- ÖsterreiBendrijje) responsi kiel malfermite por aparatoj kiuj faras kaj ne ekzitas. Tio estas migvida kiam ekzistas neniu aparato angora -epäilty εi finito lidas supren kun paratoeniro en la datumazo. 99,9% de la Tempo, εi ne estas Bendrieoje, nek e eritt Nmap, sed la reto kalazanta tiun temon. Reglamento (EB) Nr. 396 / 2005 II, III ir V priedai iš dales keičiami taip: Empresa uzantoj y ordenación habas la opcion por дусrevence sur per eltrova.o batso (pli ol...';

