$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an <code>org_id</code> column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = 'Open-Aud IT- sortipoj kun energiitaj roloj por admin, org _ Româkaj uzanto.<br/><br/>Enerale, uzanto kiu estas amministerzione de la Open- Aplika.<br/><br/>Uzanto povas havi multimajn rolojn. La permeso estos sur varamitarita sur la plej perssisiva nivelo - IE, se uzanto havas la rolojn de uzanto kaj org<br/><br/>Šio priedo 2 dalyje nurodyta: Tutmondaj eroj kiuj befolyásolja Româtutan aplikon.<br/><br/>(Žr. II priedo 5 kod. s <code>org_id</code> Bendrijuje<br/><br/>Enerale percesas legi nur alron rev...';

