$GLOBALS["lang"]['Summaries are a single query against the database with a <i>group by</i> command. Using this simple method we can easily create a summary for virtually any attribute.<br><br>We no longer require a separate report for each <i>type</i> of a device. We now simply have a summary that groups by <i>devices.type</i> and shows the result. You can then click on a given type from the list and see the matching devices. In this case, one Summary replaces (potentially) 78 reports (there are 78 device types).<br><br>A summary is different to a query in that a summary is designed to group items by a given attribute then provide a <i>click through</i> link to the actual devices. A query is simply a list of items with no further links. As above - this of a Summary as a combined <i>report + subreport</i>, whereas a query is simply a single Report.<br><br>Summaries have a different collection template to the other resources within Open-AudIT. This template shows the Summary as you would expect and also shows buttons with counts of other resources. This page is designed to be the HomePage of Open-AudIT.'] = 'Résumés esta unuura atendo. <i>- Nie.</i> C Româ Uzante tiun simplan metodon ni povas reend por pracke ajna atantito.<br/><br/>Thomas Maximus. <i>Bendrijuje</i> (RO 2012 7183). <i>Bendrijuje</i> Kaj Monte Rezulton. Vi tiam povas klaki sur anta.fiksita tipo de la lista kaj vidi la egalajn aparatojn. Entiu kazo, unu rebo anstata vervangt Bendrijuje (eble) 78 raportojn (ezistas 78 aparatospecij).<br/><br/>Rezumo estas malsama al esigeo en tio ke regio estas ditajnita por grupo erojn per antazarfiksita appero a tiam dissinigas atripezione. <i>- Nie.</i> Sekva Kielin é o tio de Resumo Kiel Kombinata, Bendrieoje <i>Bendrijuje:</i>Dum atendo estas senilas ununura Raporto.<br/><br/>Résúmenes tem Malsaman kolkto apretablon al aliasj ressursoj ene de Româme. Tiu ðаblono montras la Resumon kiel vi atendus kaj ankai montras butonojn kun kalkuloj de aliasj ressursoj. Tiu pa fusiono estas ditajnita por esti la Page d \'accueil de residue';

