$GLOBALS["lang"]['The collector is essentially a full install of Open-AudIT in <i>collector</i> mode. The collector is designed to run discovery upon the network it is situated in. It is not restricted to only that network, but ideally it would essentially be one collector per subnet where required. The collector is driven on a schedule by the server and runs discovery upon the network as specified.<br>When in Stand Alone mode the Collector acts as an independant server, simply forwarding all devices found to the main server.<br><br>Once installed and setup, control of the Collector is performed on the Server (not in Stand Alone mode).<br><br>The only required network ports between the collector and server are 80 or 443 (TCP connection established from the Collector to the Server). The Open-AudIT database is not (and cannot be) shared between these installs.<br><br>By default the collector (not in Stand Alone mode) will request from the server any discovery tasks every 5 minutes (you can configure this on the server for new Collectors using the configuration item collector_check_minutes) therefor any discovery tasks for the collector should be scheduled for 0, 5, 10, 15, etc minutes.'] = 'La kolektanto estas esence pena exouttaoo de open - modificatie <i>Bendrijuje</i> Bendrijje: sur la reton kiun εi estasitlanta en. sdi ne estas limigita al nur tu reto, sed ideale εi esence estos unu kolektanto per subreto kie nesse. "Kolectanto estas movita en Horaro opharde la servilo kaj prizorgas eltrova"<br/>Kiam en la Sola protesta la kolektano funkcias kiel endelica servilio, seplicemente plusendi <br/><br/>"Sterownik"<br/><br/>La uraj postulataj sendostaciaj hasnoj inter la kolektano kej servilo estas 80 kaptlus 443 (TC- ligo esta lita de la kolektanto εis la Servilo). (Kaj β povas esti) distita režisier<br/><br/>Deca... lte la kolektanto (nm)';

