$GLOBALS["lang"]['There is no need to do anything if you are running Open-AudIT on a Linux server.<br><br>Windows clients are just fine and require no special actions, however.... to enable this feature the audit script must be run locally on the target Windows system. It cannot be run remotely as we do with WMI calls when running the audit script on one Windows machine, while targeting a second Windows machine. To do this we need to copy the audit script to the target Windows machine and then run it. Unfortunately the service account that Apache runs under is the Local System account. This account has no access to remote (network based) resources. To work around this issue the service must be run under another account. It is easiest to just use the local Administrator account, but you can try any account you like as long as it has the required privileges. The Local System account has as much local access as the local Administrator account.'] = 'Essistas neniu bezono Farenda.o io ajn se vi prizorgas rev.<br/><br/>Fenestroj estas justaj kej postulas neniujn specialijn predjn, aliflanke... rajtigi tiun trajton la reviziomanuskripto provises et prizorgita loke sur la cel Windows- sistemon. Porcologia agoni murs kopii la reviziomanuskripton al la célio residu- ma agotadono kaj tiam prizorgi εin. Tiu raporto tem neniun alron al malpreksimaj (reto bazita) ressursoj. Por favor... Irka epäilty tu temo la nexes brunces esti prizorgita sublison. Está plej neuzi la lokan Administrateur konton, sed vi povas provision ajnan raporton vi kiel lage kiel εi havas la postulatajn ragejn. La Loka Sistemo- konto havas tien multe da loka aliro kiel la loka Administração - ko.';

