$GLOBALS["lang"]['You are able to define extra directories to be scanned as entries in the Executables collection. When defined, the directory and all sub-directories are scanned for files that are executable. You can also define directories and files to be excluded. When activated, these are injected into the linux audit script and performed whenever it is run (usually as part of a discovery). If you want these in a script you can manually copy to the target, use menu -> Discover -> Scripts -> List Scripts and download the script from there.'] = '"Exécutables colekto". (OL L 20 van 2015.177, blz. 42). V i ankai povas difini adresarojn kaj dosierojn esti ekskluditaj. Se aktivitite, tiaj estas injektitaj en la lin guidrevizian asskripton kaj rezultis kiam ajn εi estas prizorgita (kutime kiel parte de eltrova.o). Se vi deziras tiujn en manikripto vi povas mane kopii al la celo, uzi menoon - Malkovru - título Lista režisiery kaj el sortutas la sarcripton de režisiery.';

$GLOBALS["lang"]['You are always free to modify the audit scripts themselves to suit your specific requirements. You will need to (re)incorporate those changes whenever you upgrade as they will be overwritten by the default scripts. I would suggest saving a master copy of your modified script, upgrading Open-AudIT, then running a diff between the new default script and your modified script and applying the differences. The audit scripts are native scripts (Windows is VBScript, all others are Bash). Simple and easy to modify - just make sure to have a copy of your changes before you upgrade.'] = '® L \'utility de l\' energia nucléaire dans l \'industrie de l\' électriité et de l \'électriité n\' est pas Consenéée comme un problemeème. Mi remomendas рpari majstran kopion de via modifita manikripto, εisdatigante Open-, tiam Kurante Fosaon inter la nova deva... La reviziomanuskriptoj estas indiilibleenaj manikript (Windows estas VBScript "Simpla kaj") por modifi - nur cereug havi kopion de viaj tlan pilaoj anta. "Industria de l \'Union européenne est passé de 2% a 2%".';

